export default class APIService {

    static UpdateArticle(article_id: number | undefined, body: { title: string | undefined; description: string | undefined; }) {

        return fetch(`http://127.0.0.1:8000/api/articles/${article_id}/`, {
            'method':'PUT',
            headers: {
                'Content-Type':'application/json',
                'Authorization':'Token 90967bf73a23b66a6f1cc9fa584a9da33ff4aaad'
              },
              body:JSON.stringify(body)
        }).then(resp => resp.json())
    }

    static InsertArticle(body: any) {

        return fetch('http://127.0.0.1:8000/api/articles/', {
            'method':'POST',
            headers: {
                'Content-Type':'application/json',
                'Authorization':'Token 90967bf73a23b66a6f1cc9fa584a9da33ff4aaad'
              },
              body:JSON.stringify(body)
        }).then(resp => resp.json())
    }

    static DeleteArticle(article_id: any) {
        return fetch(`http://127.0.0.1:8000/api/articles/${article_id}/`, {
            'method':'DELETE',
            headers: {
                'Content-Type':'application/json',
                'Authorization':'Token 90967bf73a23b66a6f1cc9fa584a9da33ff4aaad'
              }
        })
    }

    static LoginUser(body: any) {

        return fetch('http://127.0.0.1:8000/auth/', {
            'method':'POST',
            headers: {
                'Content-Type':'application/json',
              },
              body:JSON.stringify(body)
        }).then(resp => resp.json())
    }
}
